def iroot(n,k):
    lo,hi=0,1<<((n.bit_length()+k-1)//k+1)
    while lo<hi:
        m=(lo+hi)//2
        if pow(m,k)==n: return m,True
        if pow(m,k)<n: lo=m+1
        else: hi=m
    r=lo-1; return r, pow(r,k)==n

